import { assets } from "../../Assets/assets";
import Layout from "../Layout";

function AddProduct() {
    return (
        <>
        <Layout/>
        <form>
            <p>Upload Thumbnail</p>
            <label>
                <img src = {assets.upload_area} width={120} alt=""/>
                <input type = "file" id = "image" accept="image" hidden required/>
            </label>
            <p>Blog Title</p>
            <input type = "text" placeholder="Type here" required/>
            <p>Blog Description</p>
            <text type = "text" placeholder="Type here" required/>
        </form>
        </>
    )
}

export default AddProduct;
